import React, {useEffect, useState} from "react";
const Data = () => {
    const [users, setUsers] = useState([]);

    useEffect(() => {
        fetch("http://localhost:8080/api/users")
            .then(response => response.json())
            .then(data => {
                setUsers(data);
                console.log(data);
            })
            .catch(error => {
                console.error(error);
            });
    }, []);
    return (
        <div>
            <table>
                <tr>
                    <th>Mail</th>
                    <th>Password</th>
                    <th>Name</th>
                    <th>Surname</th>
                    <th>Gender</th>
                    <th>Role</th>
                    <th>Reg. Customer</th>
                    <th>About</th>
                </tr>
                {users.map(
                    user =>  <tr key = {user.id}>
                        <td>{user.mail}</td>
                        <td>{user.password}</td>
                        <td>{user.name}</td>
                        <td>{user.surname}</td>
                        <td>{user.gender.gender}</td>
                        <td>{user.rolesList[0].role}</td>
                        <td>{user.regularCustomer.id}</td>
                        <td>{user.about}</td>
                    </tr>

                )}

            </table>
        </div>
    );
}
